import MovieCard from "components/MovieCard/Index";


import Pagination from "components/Pagination";

function Listing() {
    return (
        <>
            <Pagination />

            <div className="container">
                <div className="row">
                    <div className="col">
                        <MovieCard />
                    </div>
                </div>
            </div>

        </>
    )
}

export default Listing;
